        height: "100vh"
    }}>
         <Box sx={{
            display: 'flex',
            marginTop: "4.5rem",
            width: "975px",
            height: "600px",

        }}>
            <Paper elevation={6}>
                B

            </Paper>

                        <img src={Imagen} alt=''/>

        </Box>
    </Box>
  )
}
